// Login.js
import React from 'react'; 
import { Box, Typography, TextField, Button } from '@mui/material';
import Grid from '@mui/material/Grid';
import { Link } from 'react-router-dom';
import '../App.css'; // นำเข้าไฟล์ App.css

const Login = () => {
  return (
    <Box className="full-screen-box">
      <Grid container className="auth-container">
        {/* Left Side - Login Form */}
        <Grid item xs={12} sm={6} className="auth-box-right">
          <Typography variant="h4" sx={{ marginBottom: '1rem' }}>
            Sign In
          </Typography>

          <Box component="form" sx={{ display: 'flex', flexDirection: 'column', gap: '1rem' }}>
            <TextField label="Email" variant="outlined" fullWidth />
            <TextField label="Password" variant="outlined" fullWidth type="password" />

            <Button variant="contained" color="primary" sx={{ marginTop: '1rem' }}>
              Login
            </Button>
          </Box>
        </Grid>

        {/* Right Side - Create Account Option */}
        <Grid item xs={12} sm={6} className="auth-box-left">
          <Typography variant="h4" gutterBottom>
            Hello, Friend!
          </Typography>
          <Typography variant="body1" sx={{ marginBottom: '2rem', textAlign: 'center' }}>
            Don't have an account yet? Click below to sign up.
          </Typography>
          <Link to="/register">
            <Button className="auth-button" variant="contained">
              Sign Up
            </Button>
          </Link>
        </Grid>
      </Grid>
    </Box>
  );
};

export default Login;
